import StockMarket from "./StockMarket";

export function ContinueButton({ marketYear }: { marketYear: number }) {
    function goToMarket() {
        StockMarket(marketYear);
    }
    return (
        <div className="continue-button">
            <button
            onClick={goToMarket}>Continue to {marketYear}</button>
            </div>

    );
}
